import Layout1 from "../../layouts/layout1";
import 'jquery';
import "../../scss/index.scss";
import "antd/dist/antd.css";
import { Component } from "react";
import { NewHOC } from "../../hoc/newComponent";

class ProductPage extends Component {

    state = {
        Comp : null
    }

    componentDidUpdate(prevProps, prevState) {
        if (!this.state.Comp) {
          this.lazyLoadTodo();
        }
    }

    lazyLoadTodo = async () => {
        let Intro = await import('../../components/IndexPage/Introduce');
        this.setState({Comp: Intro});
    }

    render(){

        const {Comp} = this.state;
        const lazyLoadComp = Comp ? Comp : null;

        return (
            <Layout1>
                {lazyLoadComp}
                <button onClick={this.lazyLoadTodo}>Add</button>
            </Layout1>
        )
    }

}

export default ProductPage;
